import logo from '../../logo.svg';
import './style.css';
import { Link } from 'react-router-dom';

export function PageTwo() {
  return (
    <div className="App">

      <div className="App-line"></div>

      <main className="App-main">
        <p>
          Page 2
        </p>

        <Link to="/" className="App-link">
          Previous Page
        </Link>
      </main>
    </div>
  );
}
